import { useEffect, useState } from "react";
import { movieApi } from "../services/movieApi";

type Movie = {
  image: string;
  title: string;
  description: string;
  IMDB_Point: string;
  types: string[];
};

export default function Movies() {
  const [query, setQuery] = useState("");
  const [movies, setMovies] = useState<Movie[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    let cancelled = false;

    async function run() {
      try {
        setLoading(true);
        setError(null);

        const data = query
          ? await movieApi.search(query)
          : await movieApi.getAllMovies();

        if (cancelled) return;
        setMovies(
          data.map((m) => ({
            image: m.image,
            title: m.title,
            description: m.description,
            IMDB_Point: m.IMDB_Point,
            types: m.types,
          }))
        );
      } catch {
        if (cancelled) return;
        setError("Veri alınamadı");
      } finally {
        if (!cancelled) setLoading(false);
      }
    }

    run();
    return () => {
      cancelled = true;
    };
  }, [query]);

  return (
    <div>
      {/* Arama çubuğu */}
      <input
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        placeholder="Film, tür, yönetmen ara..."
        className="w-full md:w-96 rounded border px-3 py-2 mb-4"
        aria-label="Ara"
      />

      {/* Yükleniyor skeleton */}
      {loading && (
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-5 xl:grid-cols-6 gap-4 md:gap-6">
          {Array.from({ length: 6 }).map((_, i) => (
            <div
              key={i}
              className="rounded-xl bg-white ring-1 ring-gray-200 shadow-sm overflow-hidden"
            >
              <div className="w-full aspect-[2/3] bg-gray-200 animate-pulse" />
              <div className="p-3 space-y-2">
                <div className="h-4 w-2/3 bg-gray-200 rounded animate-pulse" />
                <div className="h-3 w-4/5 bg-gray-200 rounded animate-pulse" />
              </div>
            </div>
          ))}
        </div>
      )}

      {error && <p className="text-red-600">{error}</p>}

      {!loading && !error && movies.length === 0 && (
        <p className="text-gray-600">Sonuç bulunamadı.</p>
      )}

      {/* Kart ızgarası */}
      {!loading && !error && movies.length > 0 && (
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-5 xl:grid-cols-6 gap-4 md:gap-6">
          {movies.map((movie, index) => (
            <div
              key={`${movie.title}-${index}`}
              className="group relative overflow-hidden rounded-xl bg-white shadow-sm ring-1 ring-gray-200 transition hover:-translate-y-1 hover:shadow-lg"
            >
              <div className="relative w-full aspect-[2/3] overflow-hidden bg-gray-100">
                <img
                  src={movie.image}
                  alt={movie.title}
                  className="h-full w-full object-cover transition duration-300 group-hover:scale-105"
                  loading="lazy"
                  onError={(e) => {
                    (e.currentTarget as HTMLImageElement).src =
                      "/images/Hulk.jpg";
                  }}
                />
                <div className="pointer-events-none absolute inset-x-0 bottom-0 p-3 bg-gradient-to-t from-black/60 via-black/20 to-transparent">
                  <h3 className="text-sm font-semibold text-white line-clamp-2">
                    {movie.title}
                  </h3>
                </div>
                <span className="absolute top-2 left-2 rounded-full bg-yellow-100/90 text-yellow-800 text-[11px] font-medium px-2 py-0.5">
                  IMDB {movie.IMDB_Point}
                </span>
              </div>

              <div className="p-3 space-y-2">
                <p className="text-xs text-gray-600 line-clamp-2">
                  {movie.description}
                </p>
                <div className="flex flex-wrap gap-1.5">
                  {movie.types.map((type) => (
                    <span
                      key={type}
                      className="rounded-full bg-blue-50 text-blue-700 border border-blue-100 px-2 py-0.5 text-[10px]"
                    >
                      {type}
                    </span>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
